import React from 'react';
import './Bio.css';

const Bio = () => {
  return (
<div>
  <div className="navbar">Bio</div>
<div class="ui segment">
  <div class="ui left internal rail">
      <div class="ui segment">

className="bio">MS Nickki est une "blueswoman" née a Holly Springs (Mississippi), berceau de la musique noire américaine dont elle est une représentante aujourd'hui. Elle vous envoie sur la planète "Blues" avec un talent vocal impressionnant et un charme naturel qui ne peut vous laisser insensible... MS Nickki chante un blues profond alliant la puissance du gospel (répertoire qu'elle connaît particulièrement) et la douceur de la soul: une alchimie musicale typique de Memphis, Tennessee, cette immense ville au riche passé musical dans laquelle elle réside depuis une dizaine d'années. Ses influences majeures sont des chanteuses telles Denise LaSalle, Aretha Franklin, Tina Turner, Barbara Carr et des chanteurs originaire de Memphis tels que Johnnie Taylor et Al Green.
    </div>
  </div>
  <div class="ui right internal rail">
    <div class="ui segment">
Le combo (MS Nickki- Florian Royo - Pierre Cherbero - Julien Dubois- Eric Boréave) to ur ne régulièrement en Europe depuis une dizaine d'années et s'est produit sur des grandes scènes comme Cahors Blues Festival, Blues sur Seine, Beautiful Swamp Blues Festival, Cameros Blues Festival (Espagne). Dublin Blues Festival (Irelande), Blues Rules Festival (Suisse) et biens d'autres. Sur scène, c'est une onde de choc qui se propage ! Elle aime chanter et partager son amour pour le Blues et la Vie! Elle sait le montrer et "emmener" les gens, c'est l'école américaine du show...
    </div>
  </div>
  </div>
  </div>
    )
}

export default Bio;
